Use optional chaining for more method calls (#156938)

This rewrites code such as:

```ts
if (thing) {
    thing.method();
}
```

To the more concise:

```ts
thing?.method();
```

This was done using a simple find replace. I tried to keep the change pretty conservative so it only touches simple cases like above

issue.body:
Regex matching can fail depending on the order of alternatives, for example:

```rust
use onig::Regex;

fn main() {
    let regex_string = "Greater|GreaterOrEqual";

    let re = Regex::new(regex_string).unwrap();

    println!("Regex: {regex_string}");
    check(&re, "Greater");
    check(&re, "GreaterOrEqual");
}

fn check(regex: &Regex, input: &str) {
    let matched = regex.is_match(input);
    println!("Input: {input} = {matched}");
}
```

This produces the output:

```
Regex: Greater|GreaterOrEqual
Input: Greater = true
Input: GreaterOrEqual = false
```

If you swap the regex around to the opposite order then it passes:

```
Regex: GreaterOrEqual|Greater
Input: Greater = true
Input: GreaterOrEqual = true
```

It seems that if one of the options is a prefix of another option then the match fails for the longer alternative.

